import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const MOCK_FISH = [
  {
    _id: '1',
    name: 'Truite fario',
    scientificName: 'Salmo trutta',
    category: 'Eau douce',
    description: 'La truite fario est un poisson noble recherché pour sa combativité et sa méfiance.',
    imageUrl: 'https://images.unsplash.com/photo-1545816250-0c13b5606fa6?w=800',
    habitat: 'Rivières fraîches et oxygénées',
    averageSize: { min: 20, max: 50, unit: 'cm' },
    averageWeight: { min: 0.2, max: 2, unit: 'kg' }
  },
  {
    _id: '2',
    name: 'Brochet',
    scientificName: 'Esox lucius',
    category: 'Eau douce',
    description: 'Le brochet est le grand prédateur de nos eaux douces, réputé pour sa voracité.',
    imageUrl: 'https://images.unsplash.com/photo-1590059951637-a7d9aaa829c6?w=800',
    habitat: 'Lacs, étangs et rivières',
    averageSize: { min: 50, max: 130, unit: 'cm' },
    averageWeight: { min: 1, max: 15, unit: 'kg' }
  },
  {
    _id: '3',
    name: 'Bar',
    scientificName: 'Dicentrarchus labrax',
    category: 'Eau de mer',
    description: 'Le bar est un poisson marin très prisé pour sa chair et sa combativité.',
    imageUrl: 'https://images.unsplash.com/photo-1534043464124-3be32fe000c9?w=800',
    habitat: 'Côtes rocheuses et plages',
    averageSize: { min: 30, max: 80, unit: 'cm' },
    averageWeight: { min: 0.5, max: 6, unit: 'kg' }
  }
];

const FishCard = ({ fish }) => (
  <div className="bg-white rounded-lg shadow-lg overflow-hidden transform hover:scale-105 transition duration-200">
    <img src={fish.imageUrl} alt={fish.name} className="w-full h-48 object-cover" />
    <div className="p-4">
      <h3 className="text-xl font-bold text-nature-blue mb-2">{fish.name}</h3>
      <p className="text-sm text-gray-500 mb-2">
        {fish.scientificName && <em>{fish.scientificName}</em>}
      </p>
      <div className="mb-3">
        <span className="inline-block bg-blue-100 text-blue-800 px-2 py-1 rounded text-sm">
          {fish.category}
        </span>
      </div>
      <p className="text-gray-600 mb-4 line-clamp-2">{fish.description}</p>
      <div className="flex justify-between items-center">
        <span className="text-sm text-gray-500">
          Taille: {fish.averageSize.min}-{fish.averageSize.max} {fish.averageSize.unit}
        </span>
        <Link
          to={`/fish/${fish._id}`}
          className="text-nature-blue hover:underline"
        >
          En savoir plus
        </Link>
      </div>
    </div>
  </div>
);

const FishGuide = () => {
  const [category, setCategory] = useState('');
  const [searchTerm, setSearchTerm] = useState('');

  const filteredFish = MOCK_FISH.filter(fish => {
    const matchesCategory = !category || fish.category === category;
    const matchesSearch = !searchTerm || 
      fish.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      fish.description.toLowerCase().includes(searchTerm.toLowerCase());
    return matchesCategory && matchesSearch;
  });

  return (
    <div className="max-w-6xl mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold text-nature-blue mb-8">Guide des Poissons</h1>

      <div className="mb-8 flex flex-wrap gap-4">
        <input
          type="text"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          placeholder="Rechercher un poisson..."
          className="flex-1 p-2 border border-gray-300 rounded focus:ring-2 focus:ring-nature-blue focus:border-transparent"
        />
        <select
          value={category}
          onChange={(e) => setCategory(e.target.value)}
          className="p-2 border border-gray-300 rounded focus:ring-2 focus:ring-nature-blue focus:border-transparent"
        >
          <option value="">Tous les types</option>
          <option value="Eau douce">Eau douce</option>
          <option value="Eau de mer">Eau de mer</option>
        </select>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {filteredFish.map((fish) => (
          <FishCard key={fish._id} fish={fish} />
        ))}
      </div>

      {filteredFish.length === 0 && (
        <div className="text-center py-12">
          <p className="text-gray-600">
            Aucun poisson trouvé. Essayez d'autres critères de recherche.
          </p>
        </div>
      )}
    </div>
  );
};

export default FishGuide;
